    for (var p = 0; p < nPersons; p++) {
      var nCoords = coordinates[p].length
      if (index < nCoords) {
        //markers[i].position = coordinates[p][index]
        marker = new google.maps.Marker({
          position: coordinates[p][index],
          icon: {
            path: google.maps.SymbolPath.CIRCLE,
            scale: 5
          },
          draggable: false,
          map: map
        });
        markers[p].setMap(null)
        markers[p] = marker
      }
    }
  }, 1000);
}
